import './App.css';
import { Route, Routes, BrowserRouter as Router } from 'react-router-dom';
import Login from "./containers/NewLogin";


function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path='/NewLogin' element={<NewLogin/>} />
            </Routes>
      </Router>
    </div>
  );
}

export default App;
